(81,	1,	'2023-04-18 03:56:10',	'2023-04-18 03:56:10',	'<!-- wp:paragraph -->\r\n<p>Welcome to my website! I\'m a Full Stack WordPress Developer with a passion for crafting custom themes and plugins tailored to your needs. With expertise in HTML, CSS/Sass, PHP, and a deep understanding of the WordPress ecosystem, I\'m committed to delivering exceptional digital experiences.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>My skillset includes working with Vanilla JavaScript, jQuery, and AJAX, as well as integrating REST APIs and utilizing Version Control with Git. I\'m well-versed in WP-CLI, NPM, Gulp.js, and hosting platforms such as WP Engine and SiteGround, ensuring your projects run smoothly from start to finish.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Beyond development, I prioritize web accessibility and adhere to SEO standards, ensuring your website reaches the widest possible audience. I\'m also proficient in graphic design apps, analytics tracking, Object-Oriented Programming (OOP) principles, and agile/scrum methodologies.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Let me help you bring your vision to life, creating a website that not only looks great but performs seamlessly for you and your visitors. Get in touch today to discuss your next project!</p>\r\n<!-- /wp:columns -->',	'Home',	'',	'inherit',	'closed',	'closed',	'',	'7-revision-v1',	'',	'',	'2023-04-18 03:56:10',	'2023-04-18 03:56:10',	'',	7,	'http://huntercoxdev.local/?p=81',	0,	'revision',	'',	0),
